import "./App.css";
import React from "react";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sunburned Memoirs</h1>
        <img alt="sunset logo" src="favicon.ico" />
      </header>
    </div>
  );
}

export default App;
